import React from 'react'
import {
	StyleSheet,
	Text,
	View,
	Image,
	TouchableWithoutFeedback,
	StatusBar,
	SafeAreaView,
	Keyboard,
	TouchableOpacity,
	KeyboardAvoidingView,
	Dimensions,
	TouchableHighlight,
} from "react-native";
import Logo from '../assets/images/glow-modified.png'

const UserRegistration = () => {
  return (
    <View><Image source={Logo}></Image>
    
    
    </View>
  )
}

export default UserRegistration
